INSERT INTO `deportes` (`id`, `nombre`, `descripcion`, `historia`, `id_imagen`) VALUES
(1, 'Natacion\r\n', 'La natacion es un deporte cronometrado que requiere de mucha resistencia y velocidad, pues incorpora las tecnicas de estilo de pecho, mariposa, espalda, libre y sincronizado, en piscinas reglamentadas de 50, 100, 200, 400, 800 y 1.500 metros. Se desarrolla individual o grupalmente, en donde el atleta o equipo (por relevos), alcanzan la victoria al tocar la placa al final de la ultima vuelta.', 'Se han encontrado registros que datan de la Edad de Piedra hace 7500 anos, y tambien en epocas mas recientes en Egipto, Japon y Grecia. A inicios de siglo XIX se instauro el deporte en Gran Bretana con la fundacion de la National Swimming Society en 1837. Fue parte de los primeros Juegos Olimpicos modernos de 1896 en Atenas en la rama masculina, y a partir de 1912 en la rama femenina. Ha sido parte de todos los Juegos Panamericanos desde su primera edicion y es una competencia que se lleva buena parte de la atencion de la competencia.', 1),
(2, 'Boxeo', 'El boxeo consiste en un combate entre dos atletas que solo estan permitidos de usar los punos y golpear de la cintura para arriba dentro de un cuadrilatero. Los boxeadores se enfrentan a rivales de su propia categoria de peso, basado en un sistema de puntuacion de diez puntos. En la rama femenina es obligatorio el uso de casco protector, sin embargo, en la masculina dejo de serlo.', 'El origen de este deporte es africano. Data del ano 6000 a.C., en la antigua civilizacion egipcia, territorio que hoy es Etiopia. Luego se popularizo en la antigua Grecia y Roma. En 1743, se declararon las primeras reglas del boxeo, que se vieron revolucionadas en 1867 cuando se incluyeron rondas de tres minutos y el uso de guantes. Este deporte se incluyo en la competencia desde los primeros juegos de Buenos Aires 1951.', 2),
(3, 'Baloncesto', 'Se enfrentan dos equipos de cinco jugadores, en una cancha de 28 metros de largo por 15 de ancho. Gana el equipo que anote mas puntos introduciendo el balon en la canasta del equipo contrario, ubicada a 3,05 metros del suelo. Cada encuentro se divide en cuatro cuartos de 10 minutos cada uno. Los equipos reciben dos puntos por cada tiro normal, un punto por cada tiro libre y tres puntos por tiros lanzados mas alla de la linea de tres puntos, localizada a 6,75 metros de la canasta.', 'Su creacion ha sido atribuida al canadiense James Naismith en 1891, como metodo para ejercitar a sus alumnos en Nueva Inglaterra, Estados Unidos. Originalmente utilizo dos canastas de duraznos, y se cambiaron en 1906, por aros de metal con tableros. En la actualidad es uno de los deportes mas populares en el mundo.', 3),
(4, 'Voley', 'Seis jugadores por equipo defienden su mitad de la cancha, separados del otro equipo por una red.', 'El voleibol, inicialmente llamado mintonette, nacio el 9 de febrero de 1895 en Estados Unidos. Su inventor fue William George Morgan, profesor de educacion fisica de la YMCA Massachusetts.\r\nEl Voleibol sala es uno de los deportes mas populares, competitivos y recreativos en el mundo.', 4),
(5, 'Surf', 'Este deporte consiste en mantenerse en equilibrio encima de una tabla especial que se desplaza sobre las olas. Al ser un deporte de apreciacion, los jueces deben evaluar al surfista que realice maniobras de acuerdo a los criterios de su modalidad.', 'El Surf tiene indicios de haberse practicado en el Peru antiguo durante la epoca pre incaica, hace mas de 3,000 anos. Sin embargo, el origen del Surf moderno se remonta a inicios del siglo XX y ahora hace su debut en los Juegos Panamericanos de Lima 2019.', 5),
(6, 'Karate', 'Es la aplicacion practica de las tecnicas en un enfrentamiento o pelea contra un oponente real. En el karate actual, existen varios tipos de combate, o kumite, segun sea la finalidad de la practica, sea tradicional o deportiva, asi: Shiai kumite, o combate deportivo o de competicion, golpeando solo con superficies de impacto permitidas (fundamentalmente haciendo uso del pie o las manos), utilizando equipamiento de proteccion como guantes, protectores de empeine, protector bucal, protector corporal y en areas de contacto validas que limitan el impacto de las tecnicas, donde se busca \"marcar\" de forma explosiva, pero con mucho control en las siguientes zonas puntuables: Cabeza, cara, cuello, pecho, abdomen, zona trasera y zona lateral (costados).', 'La prohibicion de portar armas en Okinawa, Japon, durante el siglo XVII, dio origen a una de las artes marciales mas populares en todo el planeta. Esta situacion obligo a sus habitantes a desarrollar habilidades con patadas y golpes. Es ahi que nace el nombre de karate (manos vacias en japones). Este deporte fue incorporado a los Juegos Panamericanos desde Mar del Plata 1995. Brasil, Venezuela y Estados Unidos tienen nueve medallas de oro cada uno, liderando la tabla general del medallero.', 6),
(7, 'Tennis', 'El juego inicia con el servicio (preciso y giratorio o plano y poderoso), ya que quien lo realiza intenta iniciar y terminar el punto, con un movimiento de la raqueta. Un servicio puede llegar a los 250 km/h, pero el tenis no se trata solo de potencia, sino tambien de velocidad.', 'Los historiadores creen que el tenis se origino en el siglo XII en Francia, pero sin usar raquetas. En el siglo XVIII y principios del XIX, emergieron los deportes con raqueta en Inglaterra; en 1877 se jugo por primera vez un torneo de tenis, el Wimbledon.', 7),
(8, 'Beisbol', 'El equipo contrario envia a un atleta a la base del bateador para que golpee la pelota que tira el lanzador. El objetivo del lanzador es sacar al bateador con lanzamiento alto de la pelota. El objetivo del bateador es golpear la pelota y pasar por cada una de las bases para anotar. Es jugado por dos equipos de nueve jugadores cada uno, ubicandose en un campo de cesped natural o artificial, en forma de diamante, unido por cuatro bases. Cada encuentro se divide en nueve episodios o innings, con tres eliminaciones por entrada. Al termino de estos, si se mantiene el empate, el partido se extiende hasta que haya un ganador.', 'No se sabe exactamente los inicios de este deporte, pero se estima que fueron en el siglo XV en Inglaterra. El primer partido de beisbol moderno que se tiene registro fue en Ontario 1838.', 8),
(9, 'Balonmano', 'Es un deporte jugado por dos equipos de 7 jugadores cada uno (un arquero y 6 jugadores), en el que se moviliza y arroja un balon utilizando las manos hasta lograr anotar en la porteria del equipo contrario. El equipo con mas anotaciones gana.', 'Se hizo popular en el siglo XX, pero se empezo a practicar en Dinamarca, Alemania y Suecia a finales del siglo XIX. En 1917 se establecieron sus primeras reglas con la creacion de la Federacion Internacional Amateur de Balonmano. Ingreso a los Juegos Panamericanos de Indianapolis, Estados Unidos, en 1987.', 9),
(10, 'Esgrima', 'Esta disciplina se desarrolla en una pista de 14 metros de largo y 2 metros de ancho, y se emplean tres tipos de espadas distintas: florete, espada y sable. Con florete se ganan puntos al tocar al oponente con la punta del arma. Solo se puede atacar el torso, pero no los brazos. Los contactos no validos detienen la accion y no son calificados. Con la espada, mas pesada que el florete, todos los golpes tambien deben darse con la punta y no con los lados de la hoja. El objetivo aqui es tocar cualquier parte del cuerpo, y admite golpes simultaneos de ambos esgrimidores. Con el sable se puede tocar todo el cuerpo por encima de la cintura, menos las manos. Se puede atacar con el borde como con la punta. Los tocados no validos no detienen la accion. Cada partido individual dura 15 golpes o nueve minutos de tiempo efectivo. Por equipos se juega nueve partidos en intervalos de cinco golpes o tres minutos. El primer equipo en anotar 45 golpes es el ganador.', 'Si bien hay indicios de la esgrima como deporte alrededor de los 1200 a.c., fue en el siglo XV cuando se propago por todo Europa. Con los anos, se fueron adaptando espadas mas ligeras, reglas mas definidas, asi como el uso de la mascara para proteger el rostro de los deportistas.', 10);

